import {AppBar,Toolbar, Typography} from '@material-ui/core';

const NavBar = () =>{
    return(
        <AppBar>
            <Toolbar>
                <Typography component="h3">Code For Interview</Typography>
            </Toolbar>
        </AppBar>
    )
}

export default NavBar;
